import React from "react";
import "./App.css";

export const Item = React.memo(({ TODOitem }) => {
  // console.log("n = ", TODOitem);
  return (
    <React.Fragment>
      <li key={TODOitem.id}>
        <span>{TODOitem.task}</span>
        <span>
          <i className="far fa-trash-alt delete"></i>
        </span>
      </li>
    </React.Fragment>
  );
});
